import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import TypeWriterEffect from "react-typewriter-effect";

function Body(props) {
  return (
    <div>
      <Container fluid="true" style={{ marginLeft: "1rem" }}>
        <Row className="justify-content-center py-5">
          <Col md={8} sm={8}>
            {props.title && (
              <div className="display-4 font-weight-bold">{props.title}</div>
            )}

            <TypeWriterEffect
              textStyle={{
                color: "#3F3D56",
                fontWeight: 500,
                fontSize: "1.5em",
              }}
              startDelay={2000}
              cursorColor="#3F3D56"
              multiText={[
                "a builder",
                "a creater",
                "a developer",
                "an avid learner",
              ]}
              multiTextDelay={1000}
              typeSpeed={30}
            />

            {props.subTitle && (
              <div className="display-6 font-weigth-light">
                {props.subTitle}
              </div>
            )}
            {props.text && (
              <div className="lead font-weight-light">
                press <kbd className="code">cmd</kbd> +{" "}
                <kbd className="code">k</kbd> / <kbd className="code">ctrl</kbd>{" "}
                + <kbd className="code">k</kbd>
                to learn more about me
              </div>
            )}
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Body;
